import Modal from 'react-bootstrap/Modal';
import React, { Component } from 'react'

export class AbstractModal extends Component {
    render() {
        return (
            <div>
                <Modal show={true}>
                    <Modal.Header>
                        Hello
                    </Modal.Header>
                </Modal>
            </div>
        )
    }
}

export default AbstractModal;
